import React, { Component } from 'react';

class Part2 extends Component {
    constructor() {
        super();

        this.state = {
            index: 0,
        }
    }

    render() {
        return (
            <div>
                <button className="button" onClick={(e) => this.prevButton()}> Previous </button>
                <button onClick={(e) => this.nextButton()}> Next </button>
            </div>
        )
    }
}

export default Part2
